(3, 'Crushing It!: How Great Entrepreneurs Build Their Business and Influence-and How You Can, Too', '9780062674678', 'HarperBusiness', '12.84', 14, 'Four-time New York Times bestselling author Gary Vaynerchuk offers new lessons and inspiration drawn from the experiences of dozens of influencers and entrepreneurs who rejected the predictable corporate path in favor of pursuing their dreams by building thriving businesses and extraordinary personal brands.', 'In his 2009 international bestseller Crush It, Gary insisted that a vibrant personal brand was crucial to entrepreneurial success, In Crushing It!, Gary explains why thats even more true today, offering his unique perspective on what has changed and what principles remain timeless. He also shares stories from other entrepreneurs who have grown wealthierand not just financiallythan they ever imagined possible by following Crush It principles. The secret to their success (and Garys) has everything to do with their understanding of the social media platforms, and their willingness to do whatever it took to make these tools work to their utmost potential. Thats what Crushing It! teaches readers to do.\r\n\r\nIn this lively, practical, and inspiring book, Gary dissects every current major social media platform so that anyone, from a plumber to a professional ice skater, will know exactly how to amplify his or her personal brand on each. He offers both theoretical and tactical advice on how to become the biggest thing on old standbys like Twitter, Facebook, YouTube, Instagram, Pinterest, and Snapchat; podcast platforms like Spotify, Soundcloud, iHeartRadio, and iTunes; and other emerging platforms such as Musical.ly. For those with more experience, Crushing It! illuminates some little-known nuances and provides innovative tips and clever tweaks proven to enhance more common tried-and-true strategies.\r\n\r\nCrushing It! is a state-of-the-art guide to building your own path to professional and financial success, but its not about getting rich. Its a blueprint to living life on your own terms.', );
